import React from 'react'
import { Link } from 'react-router-dom'

const RouteConfig = () => {
    return (
        <div>
            <Link to="/">Home</Link>
            <Link to="/about">About</Link>
            <Link to="/contact">Contact</Link>
            <Link to="/skills">Skills</Link>
        </div>
    )
}

export default routeConfig;
